(2097, 5, 'admin/technologies', 'POST', '156.209.29.107', '{\"name\":\"Fundamentals of Android Development\",\"short_description\":\"The fundamentals of Android Development involve understanding the Android ecosystem\",\"description\":\"The fundamentals of Android is the mastering the Java or Kotlin programming languages, and utilizing the Android SDK. Key concepts include designing user interfaces with XML, managing app lifecycle and activities, handling user interactions, and developing responsive layouts. Developers must also be proficient in working with data, integrating network operations, and ensuring app compatibility across various Android devices and versions. Mastery of these core principles is essential for creating robust and user-friendly Android applications.\",\"track_id\":\"20\",\"search_terms\":null,\"_token\":\"bpu7myajMwmf95qjl0CTVFoPMsuHyHHWU3qOJUfC\"}', '2024-05-04 13:18:31', '2024-05-04 13:18:31'),
