(3344, 5, 'admin/technologies', 'POST', '154.191.51.130', '{\"name\":\"Learn the basics of networking\",\"short_description\":\"networking involves familiarizing oneself with fundamental concepts such as the OSI model\",\"description\":\"involves familiarizing oneself with fundamental concepts such as the OSI model, TCP\\/IP stack, and essential networking protocols. This includes understanding how data is organized and transmitted across different layers of the OSI model and the role of protocols like TCP, IP, ARP, and ICMP in network communication. Additionally, grasping concepts like IP addressing\",\"track_id\":\"23\",\"search_terms\":null,\"_token\":\"QTfDDkUOwGpoRHCfSMuWJpi4u4tQGHJrvWdlQsVJ\"}', '2024-06-09 03:03:37', '2024-06-09 03:03:37'),
