INSERT INTO `Quiz` (`id`, `Question`, `A`, `B`, `C`, `Correct_Answer`, `level`, `stack_id`, `created_at`, `updated_at`) VALUES
(31, 'What does HTML stand for?', 'Hyper Text Markup Level', 'Hyper Text Markup Language', 'Hyper Trainer Marking Language', 'B', 'Beginner', 1, NULL, NULL),
(32, 'What is the purpose of CSS?', 'To create web forms', 'To manage the document database', 'To style web pages', 'C', 'Beginner', 1, NULL, NULL),
(33, 'Which HTML tag is used to define an internal style sheet?', '<style>', '<script>', '<css>', 'A', 'Beginner', 1, NULL, NULL),
(34, 'What does CSS stand for?', 'Computer Style Sheets', 'Creative Style Sheets', 'Cascading Style Sheets', 'C', 'Beginner', 1, NULL, NULL),
(35, 'Which HTML attribute specifies an alternate text for an image, if the image cannot be displayed?', 'src', 'alt', 'title', 'B', 'Beginner', 1, NULL, NULL),
(36, 'What is the correct HTML tag for inserting a line break?', '<br>', '<lb>', '<break>', 'A', 'Beginner', 1, NULL, NULL),
(37, 'What property is used to change the text color of an element?', 'font-color', 'text-color', 'color', 'C', 'Beginner', 1, NULL, NULL),
(38, 'What does DOM stand for in web development?', 'Document Object Model', 'Detailed Object Markup', 'Display Object Management', 'A', 'Beginner', 1, NULL, NULL),
(39, 'What is the correct syntax for referring to an external script called \"xxx.js\"?', '<script href=\"xxx.js\">', '<script name=\"xxx.js\">', '<script src=\"xxx.js\">', 'C', 'Beginner', 1, NULL, NULL),
(40, 'Which object is the topmost object in the DOM hierarchy?', 'Document', 'Window', 'Form', 'B', 'Beginner', 1, NULL, '2024-05-05 15:27:27'),
(41, 'What method in JavaScript is used to create a new array from a called function on every element in the array?', 'map()', 'filter()', 'forEach()', 'A', 'Advanced', 1, NULL, '2024-05-05 16:19:57'),
(42, 'In React, what is a higher-order component?', 'A component that passes props to children', 'A function that takes a component and returns a new component', 'A method that returns a component hierarchy', 'B', 'Advanced', 1, NULL, '2024-05-05 16:20:27'),
(43, 'What is the purpose of the \"key\" prop in a React list component?', 'To improve performance during updates', 'To uniquely identify elements', 'Both A and B', 'C', 'Advanced', 1, NULL, '2024-05-05 16:20:29'),
(44, 'What is used in CSS to create complex animations?', '@keyframes rule', 'Animation-duration property', 'Transition-property', 'A', 'Advanced', 1, NULL, '2024-05-05 16:20:31'),
(45, 'How do you declare a CSS variable?', 'var(--my-color: blue;)', '--my-color: blue;', '$my-color: blue;', 'B', 'Advanced', 1, NULL, '2024-05-05 16:21:27'),
(46, 'Which HTML5 element is specifically designed for navigation links?', '<nav>', '<navigation>', '<links>', 'A', 'Advanced', 1, NULL, '2024-05-05 16:21:30'),
(47, 'What is the difference between sessionStorage and localStorage?', 'SessionStorage does not persist data after browser close, while localStorage does.', 'LocalStorage has smaller storage limits than sessionStorage.', 'There is no difference.', 'A', 'Advanced', 1, NULL, '2024-05-05 16:21:32'),
(48, 'Which attribute in HTML5 is used to verify that input data must be a number?', 'validate=\"number\"', 'type=\"number\"', 'input-mode=\"numeric\"', 'B', 'Advanced', 1, NULL, '2024-05-05 16:21:35'),
(49, 'What does the CSS \"box-sizing\" property do?', 'Alters the default CSS box model used to calculate widths and heights of elements.', 'Changes the border thickness of elements.', 'Adjusts the opacity of the box.', 'A', 'Advanced', 1, NULL, '2024-05-05 16:23:02'),
(50, 'What does the term \"lexicographical environment\" refer to in JavaScript?', 'The environment in which the lexical analysis of the code is performed.', 'The environment where the JavaScript is executed.', 'A specific method used for parsing.', 'B', 'Advanced', 1, NULL, '2024-05-05 16:22:16'),
(51, 'Which property in CSS is used to set the spacing between lines of text?', 'text-spacing', 'line-break', 'line-height', 'C', 'Intermediate', 1, NULL, '2024-05-05 16:22:32'),
(52, 'In JavaScript, which method is used to stop further propagation of an event?', 'event.stop()', 'event.stopPropagation()', 'event.preventDefault()', 'B', 'Intermediate', 1, NULL, '2024-05-05 16:22:35'),
(53, 'What is the purpose of the display property in CSS?', 'Controls the type of rendering box used for an element', 'Changes the visibility of an element', 'Alters the color scheme of an element', 'A', 'Intermediate', 1, NULL, '2024-05-05 16:22:38'),
(54, 'Which tag is used in HTML to embed JavaScript code?', '<javascript>', '<script>', '<js>', 'B', 'Intermediate', 1, NULL, '2024-05-05 16:22:40'),
(55, 'What attribute in HTML5 is used to specify that an input field must be filled out before submitting the form?', 'required', 'mandatory', 'needed', 'A', 'Intermediate', 1, NULL, '2024-05-05 16:22:42'),
(56, 'In CSS, what does the z-index property do?', 'Adjusts the zoom level of an element', 'Controls the stacking order of elements', 'Sets the horizontal alignment', 'B', 'Intermediate', 1, NULL, '2024-05-05 16:22:44'),
(57, 'What is the use of the async attribute in a <script> tag?', 'It keeps the script in execution order', 'It runs the script asynchronously as soon as it is available', 'It defers the execution of the script until after the page has loaded', 'B', 'Intermediate', 1, NULL, '2024-05-05 16:22:46'),
(58, 'What is a callback function in JavaScript?', 'A function passed as an argument to another function', 'A type of return statement in a function', 'A method that calls back to the server', 'A', 'Intermediate', 1, NULL, '2024-05-05 16:22:48'),
(59, 'In HTML, what is the purpose of the <link> tag?', 'To define a relationship between the document and an external resource', 'To link JavaScript files', 'To create a hyperlink', 'A', 'Intermediate', 1, NULL, '2024-05-05 16:22:50'),
