(372, 'What is the purpose of a \"softmax\" function in neural networks?', 'To activate neurons in a convolutional layer', 'To normalize the output of a network to a probability distribution', 'To perform data augmentation', 'B', 'Advanced', 11, '2024-06-09 02:42:18', '2024-06-09 02:42:18'),
(373, 'In reinforcement learning, what is a \"policy\"?', 'A strategy that the agent employs to determine its actions', 'The reward function', 'The environment model', 'A', 'Advanced', 11, '2024-06-09 02:42:19', '2024-06-09 02:42:19'),
(374, 'What does the term \"feature engineering\" refer to?', 'Building new hardware for AI applications', 'Creating new input features from existing data to improve model performance', 'Debugging software', 'B', 'Intermediate', 11, '2024-06-09 02:44:07', '2024-06-09 02:44:07'),
(375, 'Which method is often used to prevent overfitting in deep learning models?', 'Increasing the learning rate', ')Decreasing the batch size', 'Using dropout regularization', 'C', 'Intermediate', 11, '2024-06-09 02:44:12', '2024-06-09 02:44:12'),
(376, 'What is the vanishing gradient problem in deep learning?', 'When the gradient increases exponentially', 'When the gradient diminishes as it is backpropagated through the network layers, making training difficult', 'When the gradient oscillates during training', 'B', 'Intermediate', 11, '2024-06-09 02:44:13', '2024-06-09 02:44:13'),
(377, 'What is the purpose of the Adam optimizer in neural networks?', 'To initialize weights', 'To adjust the learning rate dynamically based on the training process', 'To preprocess input data', 'B', 'Intermediate', 11, '2024-06-09 02:44:14', '2024-06-09 02:44:14'),
(378, 'What is an autoencoder?', 'A supervised learning algorithm', 'A type of neural network used to learn efficient codings of input data, typically for dimensionality reduction', 'A reinforcement learning model', 'B', 'Intermediate', 11, '2024-06-09 02:44:15', '2024-06-09 02:44:15'),
(379, 'Which evaluation metric is particularly useful for imbalanced datasets in classification problems?', 'A) Accuracy', 'B) Precision-Recall Curve', 'C) Mean Squared Error', 'B', 'Advanced', 11, '2024-06-09 02:45:14', '2024-06-09 02:45:14'),
(380, 'What is the difference between L1 and L2 regularization?', 'A) L1 regularization adds the absolute value of weights to the loss function, while L2 adds the squared value of weights', 'B) L1 is used for classification, while L2 is used for regression', 'C) L1 regularization is faster than L2', 'A', 'Advanced', 11, '2024-06-09 02:45:14', '2024-06-09 02:45:14'),
(382, 'What does the term \'malware\' stand for?', 'Malicious Software', 'Malfunctioning Software', 'Manual Software', 'A', 'Beginner', 8, '2024-06-09 03:47:14', '2024-06-09 03:47:14'),
(383, 'Which of the following is a common type of cyber attack?', 'Phishing', 'Phasing', 'Phosting', 'A', 'Beginner', 8, '2024-06-09 03:47:14', '2024-06-09 03:47:14'),
(384, 'What is a firewall?', 'A security system that controls incoming and outgoing network traffic', 'A physical barrier to stop intruders', 'A type of virus', 'A', 'Beginner', 8, '2024-06-09 03:47:15', '2024-06-09 03:47:15'),
(390, 'Which of the following is a good practice for cybersecurity?', 'A) Sharing your passwords with friends', 'B) Using the same password for all accounts', 'C) Regularly updating software and systems', 'C', 'Beginner', 8, '2024-06-09 03:49:37', '2024-06-09 03:49:37'),
(391, 'What is \'encryption\' in cybersecurity?', 'A) A process of compressing data', 'B) A method of converting readable data into an unreadable format', 'C) A way to speed up data transmission', 'B', 'Beginner', 8, '2024-06-09 03:49:37', '2024-06-09 03:49:37'),
(392, 'What does the term \'phishing\' refer to in cybersecurity?', ')A fishing expedition', 'A method of hunting for bugs in the code', 'An attempt to acquire sensitive information by pretending to be a trustworthy entity', 'C', 'Beginner', 8, '2024-06-09 03:50:35', '2024-06-09 03:50:35'),
(393, 'What is a \'botnet\'?', 'A network of bots used for legitimate purposes', 'A network of computers infected with malware and controlled as a group', 'A new type of social network', 'B', 'Beginner', 8, '2024-06-09 03:50:36', '2024-06-09 03:50:36'),
(397, 'What is the primary function of a Security Information and Event Management (SIEM) system?', 'To encrypt data', 'To monitor and analyze security alerts and events in real-time', 'To manage user passwords', 'B', 'Advanced', 8, '2024-06-09 03:53:56', '2024-06-09 03:53:56'),
(398, 'What is the principle of \'defense in depth\'?', 'Relying on a single security measure', 'Implementing multiple layers of security controls to protect assets', 'Disabling unnecessary security features for performance', 'B', 'Advanced', 8, '2024-06-09 03:53:56', '2024-06-09 03:53:56'),
(399, 'What does \'threat modeling\' involve in cybersecurity?', 'Designing secure networks', 'Identifying and prioritizing potential threats to a system', 'Writing secure code', 'B', 'Advanced', 8, '2024-06-09 03:53:57', '2024-06-09 03:53:57'),
(400, 'What is \'Advanced Persistent Threat\' (APT)?', 'A minor security risk that can be ignored', 'A type of malware that is easily detectable', 'A prolonged and targeted cyberattack in which an intruder gains access to a network and remains undetected for an extended period', 'C', 'Advanced', 8, '2024-06-09 03:53:58', '2024-06-09 03:53:58'),
(401, 'What is \'data loss prevention\' (DLP) in cybersecurity?', 'A strategy to backup data regularly', 'A system designed to detect and prevent unauthorized access to or transfer of sensitive information', 'A method for speeding up data access', 'B', 'Advanced', 8, '2024-06-09 03:56:02', '2024-06-09 03:56:02'),
(402, 'What does the term \'red teaming\' refer to in cybersecurity?', 'Developing security policies', 'Conducting offensive security tests to identify vulnerabilities and improve defenses', 'Monitoring network traffic', 'B', 'Advanced', 8, '2024-06-09 03:56:02', '2024-06-09 03:56:02'),
(403, 'What is the role of an \'Incident Response Team\' (IRT) in cybersecurity?', 'To develop new software features', 'To respond to and manage security incidents and breaches', 'To write documentation', 'B', 'Advanced', 8, '2024-06-09 03:56:04', '2024-06-09 03:56:04'),
(404, 'What is a \'zero trust\' security model?', 'Assuming that all users and devices are trusted by default', 'Assuming that no one inside or outside the network is trusted by default', 'Using only physical security measures', 'B', 'Advanced', 8, '2024-06-09 03:56:05', '2024-06-09 03:56:05'),
(405, 'What is \'SOC 2\' compliance?', 'A) A standard for data encryption', 'B) A framework for managing IT services', 'C) A set of criteria for managing customer data based on five \"trust service principles\" – security, availability, processing integrity, confidentiality, and privacy', 'C', 'Advanced', 8, '2024-06-09 03:57:09', '2024-06-09 03:57:09'),
(406, 'What is \'privilege escalation\' in the context of cybersecurity?', 'A) Reducing user privileges for security', 'B) Exploiting a bug or design flaw to gain elevated access to resources that are normally protected', 'C) Blocking access to a system', 'B', 'Advanced', 8, '2024-06-09 03:57:10', '2024-06-09 03:57:10'),
(407, 'What is the principle of \'least privilege\' in cybersecurity?', 'Giving all users the same level of access', 'Providing users with the minimum level of access necessary to perform their jobs', 'Allowing full access to everyone', 'B', 'Intermediate', 8, '2024-06-09 04:09:45', '2024-06-09 04:09:45'),
(408, 'What is a \'zero-day exploit\'?', 'An exploit known to the software vendor but not yet patched', 'An exploit that has been fixed on the same day it was found', 'A vulnerability that is publicly known and patched', 'A', 'Intermediate', 8, '2024-06-09 04:10:28', '2024-06-09 04:10:28'),
(409, 'Which type of attack is characterized by overwhelming a system with traffic to make it unavailable?', 'Man-in-the-middle attack', 'SQL injection', 'Distributed Denial of Service (DDoS) attack', 'C', 'Intermediate', 8, '2024-06-09 04:10:59', '2024-06-09 04:10:59'),
(410, 'What does \'multi-factor authentication\' (MFA) entail?', 'Using a single password for access', 'Using two or more verification methods to gain access', 'Using an easily guessed password', 'B', 'Intermediate', 8, '2024-06-09 04:11:32', '2024-06-09 04:11:32'),
(411, 'Which of the following is a common technique used in social engineering attacks?', 'Encrypting data', 'Installing firewalls', 'Manipulating individuals into divulging confidential information', 'C', 'Intermediate', 8, '2024-06-09 04:12:17', '2024-06-09 04:12:17'),
(412, 'What is a \'honeypot\' in cybersecurity?', 'A tool for encrypting data', 'A decoy system designed to lure and analyze potential attackers', 'A type of malware', 'B', 'Intermediate', 8, '2024-06-09 04:12:47', '2024-06-09 04:12:47'),
(413, 'What is \'SQL injection\'?', 'A method for injecting malicious code into a web server', 'A technique used to secure databases', 'An attack that inserts malicious SQL queries into input fields', 'C', 'Intermediate', 8, '2024-06-09 04:13:33', '2024-06-09 04:13:33'),
(414, 'Which protocol is commonly used to secure web communications?', 'FTP', 'HTTP', 'C) HTTPS', 'C', 'Intermediate', 8, '2024-06-09 04:13:53', '2024-06-09 04:13:53'),
(415, 'What is the primary purpose of penetration testing?', 'To create secure passwords', 'To test the strength of encryption algorithms', 'To identify and exploit vulnerabilities in a system', 'C', 'Intermediate', 8, '2024-06-09 04:14:27', '2024-06-09 04:14:27'),
(416, 'What is \'ransomware\'?', 'Software that provides free services', 'Malicious software that locks or encrypts a user\'s data and demands payment for its release', 'A type of antivirus software', 'B', 'Intermediate', 8, '2024-06-09 04:15:15', '2024-06-09 04:15:15');
