INSERT INTO `technologies` (`id`, `name`, `short_description`, `description`, `created_at`, `updated_at`, `track_id`) VALUES
(4, 'HTML', 'HTML serves as the fundamental foundation of the Web', 'HTML serves as the fundamental foundation of the Web, establishing the significance and organization of web content. Additional technologies, such as CSS for styling.', '2024-04-26 19:27:27', '2024-05-02 13:53:27', 6),
(5, 'CSS', 'CSS is the language we use to style a Web page.', 'CSS is the language we use to style an HTML document.CSS describes how HTML elements should be displayed.CSS references of all properties and selectors with syntax, examples, browser support, and more.\r\nCSS stands for Cascading Style Sheets\r\nCSS describes how HTML elements are to be displayed on screen, paper, or in other media\r\nCSS saves a lot of work. It can control the layout of multiple web pages all at once\r\nExternal stylesheets are stored in CSS files', '2024-04-26 19:28:20', '2024-04-26 20:25:47', 6),
(6, 'java script', 'JavaScript is the Programming Language for the Web.', 'JavaScript serves as the programming language specifically designed for the web. It possesses the capability to modify and alter both HTML and CSS elements.', '2024-04-26 19:32:38', '2024-05-02 13:58:42', 6),
(7, 'Bootstrap', 'Bootstrap is the most popular CSS Framework for developing responsive and mobile-first websites.', 'Bootstrap 5 is the newest version of Bootstrap.\r\nBootstrap is a free, open-source front-end development framework for creating websites and web apps. Designed to enable responsive development of mobile-first websites, Bootstrap provides a collection of syntax for template designs.', '2024-04-26 19:33:35', '2024-04-29 21:16:18', 8),
(8, 'Tailwind CSS', 'Tailwind CSS works by scanning all of your HTML files', 'Tailwind CSS scans all of your HTML files, JavaScript components, and any other templates for class names, generates the corresponding styles, and then writes them to a static CSS file.', '2024-04-26 19:33:47', '2024-04-29 21:31:07', 8),
(9, 'Foundation', 'A Framework for any device, medium, and accessibility', 'A Framework for any device, medium, and accessibility. The foundation is a family of responsive front-end frameworks that make it easy to design beautiful responsive websites, apps, and emails that look amazing on any device. The foundation is semantic, readable, flexible, and completely customizable. We’re constantly adding new resources and code snippets, including these handy HTML templates to help get you started!', '2024-04-26 19:33:55', '2024-04-29 21:21:56', 8),
(11, 'View.js', 'is an open-source model–view–viewmodel front end JavaScript library', 'It is an open-source model–view–viewmodel front-end JavaScript library for building user interfaces and single-page applications. It was created by Evan You and is maintained by him and the rest of the active core team members.', '2024-04-26 19:37:21', '2024-04-29 21:35:52', 9),
(13, 'React.js', 'React is a JavaScript library created by Facebook', 'React is a JavaScript library created by Facebook\r\nReact is a User Interface (UI) library\r\nReact is a tool for building UI components', '2024-04-26 19:37:36', '2024-04-29 21:42:43', 9),
(17, 'Sass', 'Sass stands for Syntactically Awesome Stylesheet', 'Sass is an extension to CSS\r\nSass is a CSS pre-processor\r\nSass is completely compatible with all versions of CSS\r\nSass reduces the repetition of CSS and therefore saves time\r\nSass was designed by Hampton Catlin and developed by Natalie Weizenbaum in 2006\r\nSass is free to download and use', '2024-04-26 19:38:06', '2024-04-29 21:53:11', 11),
(19, 'Less', 'It is a backward-compatible language extension for CSS.', 'It is a backward-compatible language extension for CSS. It allows us to use features like variables, nesting, mixins, etc, all in a CSS-compatible syntax. LESS is influenced by SASS and has influenced the newer “SCSS” syntax of SASS.', '2024-04-26 19:38:21', '2024-04-29 22:00:14', 11),
(20, 'GitHub', 'Is a platform that provides hosting', 'It is a platform that provides hosting for Git repositories and adds additional features such as issue tracking, collaboration tools, and continuous integration. Developers and teams widely use it to manage code, collaborate on projects, and contribute to open-source software. GitHub is not Git itself but rather a service built around Git to enhance its functionality.', '2024-04-26 19:38:27', '2024-04-29 22:10:09', 12),
(21, 'API', 'APIs are mechanisms', 'APIs are mechanisms that enable two software components to communicate with each other using a set of definitions and protocols.', '2024-04-26 19:38:35', '2024-04-29 22:16:16', 12),
(23, 'Algorithm and Datastructure', 'Data structures are ways of organizing and storing data in a computer.', 'Data structures are ways of organizing and storing data in a computer. Data structures include arrays, linked lists, stacks, queues, trees, and graphs. Algorithms are sets of steps for solving problems. Basic algorithms include sorting, searching, and recursion.', '2024-04-26 19:38:48', '2024-04-29 22:39:56', 12),
(31, 'PHP', 'It was originally created by Danish-Canadian programmer Rasmus Lerdorf in 1993 and released in 1995.', 'The PHP reference implementation is now produced by the PHP Group.\r\n        PHP was originally an abbreviation of Personal Home Page,\r\n        but it now stands for the recursive initialism PHP: Hypertext Preprocessor.', '2024-04-27 19:49:44', '2024-04-29 20:44:30', 15),
(32, 'PHP_Framwork', 'Laravel', 'Laravel is a free and open-source PHP-based web framework for building high-end web applications', '2024-04-27 19:50:59', '2024-04-29 20:54:21', 15),
(33, 'MySQL Database', 'a full description\" is correct and usable in written English', 'a full description\" is correct and usable in written English. You can use it whenever you are referring to a complete, \r\ndetailed account of something. For example: \"The detective asked for a full description of the suspect', '2024-04-29 21:02:23', '2024-04-29 21:02:23', 15),
(34, 'Node.js', 'for executing JavaScript code. Node is used extensively for server-side programming', 'for executing JavaScript code. Node is used extensively for server-side programming,\r\n  making it possible for developers to use JavaScript for client-side and server-side code without needing to learn an additional language.', '2024-04-29 21:11:00', '2024-04-29 21:11:00', 17),
(35, 'Express  node js framewor', 'Express is the most popular Node web framework', 'Express is the most popular Node web framework, and is the underlying library for a number of other popular Node web frameworks. It provides mechanisms to: Write handlers for requests with different HTTP verbs at different URL paths (routes).', '2024-04-29 21:17:11', '2024-04-29 21:17:11', 17),
(36, 'MongoDB', 'database that provides support for JSON-like storage', 'is a non-relational document database that provides support for JSON-like storage. The MongoDB database has a flexible data model that enables you to store unstructured data, and it provides full indexing support, and replication with rich and intuitive APIs.', '2024-04-29 21:22:59', '2024-04-29 21:29:19', 17),
(37, 'Python', 'language with dynamic semantics developed by Guido van Rossum', 'language with dynamic semantics developed by Guido van Rossum. It was originally released in 1991. Designed to be easy as well as fun, the name \"Python\" is a nod to the British comedy group Monty Python', '2024-04-29 21:30:41', '2024-04-29 21:30:41', 18),
(38, 'Flask', 'what\'s known as a WSGI framework', 'Mercifully pronounced “whiskey,” this stands for ​​Web Server Gateway Interface. Essentially,\r\n this is a way for web servers to pass requests to web applications or frameworks. Flask relies on the WSGI external library to function, as well as the Jinja2 template engine.', '2024-04-29 21:47:47', '2024-04-29 21:47:47', 18),
(39, 'DjangoDB', 'The Django web framework is a free', 'The Django web framework is a free, open source framework that can speed up development of a web application being built in the Python programming language.\r\n Django—pronounced “Jango,” named after the famous jazz guitarist Django Reinhardt—is a free, open source framework that was first publicly released in 2005.', '2024-04-29 21:51:36', '2024-04-29 21:51:36', 18),
(40, 'flyweel', 'Local by Flywheel simplifies WordPress', 'Local by Flywheel simplifies WordPress development by providing an intuitive platform to create, test, and manage sites locally. Its user-friendly interface eliminates manual server setup, enabling quick site deployment. With one-click cloning and easy sharing, collaboration becomes effortless. Integration with Git ensures efficient version control for solo or team projects. In essence, Local streamlines the development process, empowering users to build WordPress sites with speed and confidence.', '2024-04-29 22:50:55', '2024-04-29 22:50:55', 19),
(41, 'Docker', 'Docker is a platform for developing', 'Docker is a platform for developing, shipping, and running applications in containers. Containers are lightweight, portable, and self-sufficient units that encapsulate an application along with its dependencies, such as libraries and runtime environments. Docker provides tools and APIs for creating, managing, and orchestrating containers, making it easier to develop and deploy applications across different environments consistently.', '2024-04-29 22:57:44', '2024-04-29 22:57:44', 19),
(42, 'basic of java/kotlin', 'Java and Kotlin are popular programming languages used for building various types of software applications.', 'Java/Kotlin are powerful, object-oriented programming languages used for building a wide range of applications, from mobile apps to enterprise software.', '2024-05-04 12:49:45', '2024-05-04 13:08:49', 20),
(44, 'Fundamentals of Android', 'The fundamentals of Android Development involve understanding the Android ecosystem', 'The fundamentals of Android is the mastering the Java or Kotlin programming languages, and utilizing the Android SDK. Key concepts include designing user interfaces with XML, managing app lifecycle and activities, handling user interactions, and developing responsive layouts. Developers must also be proficient in working with data, integrating network operations, and ensuring app compatibility across various Android devices and versions. Mastery of these core principles is essential for creating robust and user-friendly Android applications.', '2024-05-04 13:18:31', '2024-05-04 13:19:59', 20),
(45, 'Data storage', 'Data storage for Android involves several options for saving and retrieving data within an app', 'Data storage for Key methods include SharedPreferences for storing simple key-value pairs, internal and external storage for files, SQLite databases for structured data storage, and the Room persistence library for a higher-level abstraction over SQLite. These methods cater to different data storage needs, from saving user preferences to handling complex data structures.', '2024-05-04 13:30:48', '2024-05-04 13:30:48', 20),
(46, 'Networking and APIs', 'Networking and APIs in Android development involve connecting to web services and retrieving, sending, or processing data over the internet', 'This is typically achieved using HTTP requests to interact with RESTful APIs, with data formats like JSON or XML. Android provides several ways to handle network operations, such as using the HttpURLConnection class or third-party libraries like Retrofit for more efficient and organized handling of API requests and responses. Proper implementation ensures seamless data exchange and integration with remote servers.', '2024-05-04 13:44:03', '2024-05-04 13:44:03', 20),
(47, 'Firebase Integration', 'Integrating Firebase into your application can provide powerful real-time data syncing, authentication, and hosting capabilities', 'Enhance your application with Firebase, a comprehensive platform that provides real-time database syncing, user authentication, and cloud storage. Firebase offers seamless integration with web and mobile applications, enabling you to build dynamic, responsive experiences for your users. With Firebase, you can easily add features like chat, notifications, and analytics, while also benefiting from Google\'s robust infrastructure for scalability and reliability', '2024-05-04 13:57:51', '2024-05-04 13:57:51', 20),
(48, 'Difference Between UI & UX', 'UI (User Interface) and UX (User Experience) are two closely related', 'UI (User Interface) and UX (User Experience) are two closely related but distinct concepts in the field of design, particularly in the realm of digital products like websites and mobile apps', '2024-06-08 22:01:55', '2024-06-08 22:01:55', 21),
(49, 'Choosing tool with Adobe XD / Figma', 'Choosing between Adobe XD and Figma depends on your specific needs and preferences', 'Adobe XD offers seamless integration with other Adobe Creative Cloud apps, making it a preferred choice for designers already using Adobe software', '2024-06-08 22:01:56', '2024-06-08 22:04:44', 21),
(50, 'Understand the platform guidelines that design makes', 'Understanding platform guidelines is crucial for designers', 'Understanding platform guidelines is crucial for designers as they ensure that their designs adhere to the standards and conventions of the platform on which they\'re designing', '2024-06-08 22:01:57', '2024-06-08 22:01:57', 21),
(51, 'Basics of UI Design', 'UI (User Interface) design focuses on creating visually appealing and intuitive interfaces', 'UI (User Interface) design focuses on creating visually appealing and intuitive interfaces for digital products such as websites, mobile apps, and software applications', '2024-06-08 22:01:58', '2024-06-08 22:01:58', 21),
(52, 'Learning Mathematics', 'Learning mathematics for artificial intelligence (AI) is akin to exploring the language of the universe', 'Learning mathematics for artificial intelligence (AI) is akin to exploring the language of the universe, as mathematics serves as the foundation upon which AI algorithms are built and optimized.', '2024-06-09 01:52:39', '2024-06-09 01:52:39', 22),
(53, 'Python For ML And DL', 'Python has emerged as the go-to language for machine learning and deep learning due to its simplicity, flexibility, and vast ecosystem of libraries and tools.', 'Python is a powerful and versatile programming language widely used in the fields of machine learning (ML) and deep learning (DL) within artificial intelligence (AI).', '2024-06-09 01:52:39', '2024-06-09 01:52:39', 22),
(54, 'Fundamentals Of ML And DL', 'Machine learning and deep learning are key components of artificial intelligence, enabling systems to learn from data and make decisions autonomously.', 'Machine Learning is a subset of artificial intelligence (AI) that focuses on developing algorithms and statistical models that enable computers to perform tasks without explicit instructions.', '2024-06-09 01:52:40', '2024-06-09 01:52:40', 22),
(55, 'Learn the basics of networking', 'networking involves familiarizing oneself with fundamental concepts such as the OSI model', 'involves familiarizing oneself with fundamental concepts such as the OSI model, TCP/IP stack, and essential networking protocols. This includes understanding how data is organized and transmitted across different layers of the OSI model and the role of protocols like TCP, IP, ARP, and ICMP in network communication. Additionally, grasping concepts like IP addressing', '2024-06-09 03:03:37', '2024-06-09 03:03:37', 23),
(56, 'CCNA Security', 'Security provides foundational knowledge and skills in implementing and monitoring security measures to protect Cisco networks', 'The certification covers topics such as securing network devices, implementing firewalls, VPNs, and intrusion prevention systems, and implementing AAA (Authentication, Authorization, and Accounting) security protocols. Additionally, it addresses core security concepts, including threat mitigation, endpoint security, and security policies and procedure.', '2024-06-09 03:03:37', '2024-06-09 03:03:37', 23),
(57, 'Linux', 'is a widely used open-source operating system kernel that serves as the foundation for various Linux distributions', 'is a widely used open-source operating system kernel that serves as the foundation for various Linux distributions, including Ubuntu, CentOS, Debian, and Fedora. Developed by Linus Torvalds in 1991, Linux is known for its stability, security, and flexibility, making it a popular choice for servers, desktops, embedded systems, and mobile devices.', '2024-06-09 03:03:38', '2024-06-09 03:03:38', 23),
(58, 'Firewalls', 'are designed to protect networks and systems from unauthorized access, malicious attacks, and unwanted traffic', 'designed to protect networks and systems from unauthorized access, malicious attacks, and unwanted traffic. They enforce security policies by inspecting packets of data and determining whether to allow or block them based on predefined rules.', '2024-06-09 03:03:39', '2024-06-09 03:03:39', 23),
(59, 'Fundamentals of Network', 'The fundamentals of network in network, often abbreviated as NIN,', 'The fundamentals of network in network, often abbreviated as NIN, refer to a concept in computer networking where a network is encapsulated within another network.', '2024-06-09 04:25:20', '2024-06-09 04:25:20', 24),
(60, 'Network protocols and CCNA Fundamentals', 'Network protocols are a set of rules and conventions that govern how data is transmitted and received over a network', '\'Network protocols are a set of rules and conventions that govern how data is transmitted and received over a network. These protocols define the format and sequence of messages exchanged between devices to enable communication.\',', '2024-06-09 04:25:20', '2024-06-09 04:25:20', 24),
(61, 'Windows Server certification validates skills (MCSA)', 'The Microsoft Certified Solutions Associate (MCSA) : Windows Server certification validates', '\'The Microsoft Certified Solutions Associate (MCSA) : Windows Server certification validates the skills and knowledge required to effectively manage and maintain Windows Server environments.\',', '2024-06-09 04:25:22', '2024-06-09 04:25:22', 24),
(62, 'XAMPP', 'Developers can create and test websites offline with its user-friendly interface. Offering flexibility and quick deployment.\',', 'simplifies web development by bundling Apache, MySQL, PHP, and more for easy setup of a local server', '2024-06-10 12:16:51', '2024-06-10 12:16:51', 19),
(63, 'MAMP', 'is a local server environment for macOS, perfect for web development with Apache, MySQL, and PHP.', 'Its intuitive interface makes setup easy for developers of any skill level. With MAMP, creating and testing websites offline is seamless and efficient', '2024-06-10 12:16:51', '2024-06-10 12:16:51', 19),
(64, 'Wordpress', 'is a versatile CMS built on PHP and MySQL, with a user-friendly interface for content management and publishing.', 'It offers extensive customization with themes and plugins, SEO-friendly features, and responsive design options', '2024-06-10 12:16:52', '2024-06-10 12:16:52', 19),
(65, 'dart', 'Dart is a modern, object-oriented programming language', 'Dart is a modern, object-oriented programming language developed by Google, specifically designed for building user interfaces with its Flutter framework', '2024-06-10 12:45:52', '2024-06-10 12:45:52', 25),
(67, 'Flutter', 'Flutter is an open-source UI toolkit from Google, designed for developing natively', 'Flutter is an open-source UI toolkit from Google, designed for developing natively compiled applications for mobile, web, and desktop using a single codebase', '2024-06-10 13:02:17', '2024-06-10 13:02:17', 25),
(68, 'Firebase', 'Firebase offers a powerful duo for app development,', 'Firebase offers a powerful duo for app development, streamlining the process from design to deployment.', '2024-06-10 13:03:00', '2024-06-10 13:03:00', 25),
(69, 'SQL', 'Flutter app with a SQL database involves several steps', 'Flutter app with a SQL database involves several steps. including setting up the Flutter app, integrating a SQL database, and performing basic CRUD operations.', '2024-06-10 13:14:00', '2024-06-10 13:14:00', 28),
(70, 'SQL Lite', 'C-language library that provides a lightweight, disk-based database.', '. It doesn’t require a separate server process and allows access to the database using a nonstandard variant of the SQL query language. Here is a guide to using SQLite with Flutter, focusing on setting up, performing CRUD operations, and ensuring best practices', '2024-06-10 13:14:34', '2024-06-10 13:14:34', 28);
