(21, 'UI/UX_design', 'Advanced', 'asd', 12, '2024-06-08 21:52:01', '2024-06-14 11:55:25', 'UI (User Interface) and UX (User Experience) design are integral components of creating digital products like websites, apps, and software. While they are closely related, they focus on different aspects of the user’s interaction with a product.'),
